import styled from "styled-components";

export const Cocacola = styled.div`
.doc{
  display: flex;
  flex-flow: column wrap;
  width: 100vw;
  height: 100vh;
  justify-content: center;
  align-items: center;
  background: #333944;
}

.box{
  width: 100vw;
  height: 50vh;
  background: #CCC;
  overflow: hidden;
}
  .box img {
    width: 100%;
    height: auto;
  }
  @supports (object-fit: cover) {
    .box img {
      height: 100%;
      object-fit: cover;
      object-position: center center;
    }

`;
